package com.omniscien.lsmetric.model;

public class DetailIncludeTextModel {

	public DetailIncludeTextModel() {
		// TODO Auto-generated constructor stub
	}
	
	private String can;
	private String ref;
	private double cs;
	private double ci;
	public String getCan() {
		return can;
	}
	public void setCan(String can) {
		this.can = can;
	}
	public String getRef() {
		return ref;
	}
	public void setRef(String ref) {
		this.ref = ref;
	}
	public double getCs() {
		return cs;
	}
	public void setCs(double cs) {
		this.cs = cs;
	}
	public double getCi() {
		return ci;
	}
	public void setCi(double ci) {
		this.ci = ci;
	}
	
	

}
